import { useContext } from "react";

import MyContext from "../my_context";

const Carousel = () => {
    const { artworks } = useContext(MyContext);
    return(
        <>
        <div>
            {artworks.map(
                    (element, index) => (
                        <div key={index}>                            
                                <img src={element.url_image} alt="imagen obra"></img>
                        </div>                        
                    )
                )
                }
        </div>
        <div>
            <h1>carousel</h1>
            <img src={artworks[0].url_image}></img>
        </div>
        </>
        
    )
}
export default Carousel;
